import React from 'react';
function single_product_list(props){
    {products.map(({productid,productname,productprice,sellername,image_path})=>(
        <div>
            <div style={{'width':'40%'}}>
                <img src={image_path}/>
            </div>
            <div style={{'width':'60%'}}>
                <div style={{'width':'100%'}}>
                    <Link to={"/productdisplay/"+productid} key={productid}><h4>{productname}</h4></Link>
                </div>
                <div style={{'width':'100%'}}>
                    {sellername}
                </div><br/>
                <div style={{'width':'100%'}}>
                    {productprice}
                </div>
            </div>
        </div>
    ))};
}
export default single_product_list;
